package newpack1;

public class IfElseIf_Block {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a = 150;
		int b = 700;
		if (a == b) {
			System.out.println("equal");
		} else {
			System.out.println("Not equal");
		}
		if (a >= b) {
			System.out.println("wrong");
		}

	}

}
